export default function TransActionComponent({transActions}){
return(
    <section>
        {transActions.length &&
        transActions.map(t => (
            <div key={t.id} className="transaction" style={{borderRightColor: t.type === "expense" && "red"}}>
                <span>{t.desc}</span>
                <span>{t.amount} $</span>
            </div>
        ))}
    </section>
)
}
